      | 36514 -> { ItemTypeData.id= 36514; name= "Women's 'Hephaestus' Shoes (cyan)"; published= true; description= "Designer: Vallou Outerwear  When Outer Ring Excavations was looking to update and modernize their crew uniforms, they relied on Vallou Outerwear to take on the challenge. Vallou upper management was so impressed with the result, they commissioned a limited range of custom variants, known as the “Hephaestus” collection.   These functional but high tech shoes retain the utilitarian look of the original uniforms, but with much higher material quality and attention to detail. Each pair of shoes are crafted from cyan-shaded materials and fabrics that are extremely durable yet comfortable enough to wear for extended periods."; marketGroupId= Some(1404); groupId= 1091; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 0.100000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.500000 }; { DogmaAttributeValueData.attributeId = 1773; value= 3.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.500000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
      | 365441 -> { ItemTypeData.id= 365441; name= "RS-90 Combat Rifle"; published= false; description= "A gas-operated, short-barreled weapon, the combat rifle is a semi-automatic weapon well-suited to both short and medium range combat. Classified as a light support weapon, it is typically employed in target-rich environments where the high volume of fire produced enables operators to engage multiple targets in rapid succession, whilst the weapon’s extended range keeps the operator just beyond the threat threshold of most standard assault rifles.    Its advanced bullpup configuration reduces weapon weight and improves maneuverability making it the ideal cross-over weapon for urban and field combat. The modular design has more practical advantages as well in that it’s cheap to maintain and easily replaced if damaged, making it one of the most reliable weapons in service today."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365635 -> { ItemTypeData.id= 365635; name= "'Construct' Allotek Plasma Cannon"; published= false; description= "The plasma cannon is a single-shot, direct-fire weapon developed by Allotek Industries primarily for use in urban operations and confined space combat. The dense plasma discharge it generates is highly unstable, decaying rapidly and venting sufficient heat and energy to severely damage targets caught within its critical emission radius.    During the short pre-fire charge, ultracold plasma is prepared and then heated inside a magneto-core trap. Just prior to discharge, a small precursor projectile is fired that produces (and is ultimately consumed by) a short-lived trail that helps guide and contain the volatile discharge as it travels towards its target."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
